import styles from './Site.module.css';


function Site() {
   return <div>
       <div className={styles.header}>Header</div>
       <div className={styles.body}>
           <div className={styles.nav}>1234</div>
           <div className={styles.content}>Content</div>
       </div>
   </div>
}

export default Site;
